  \"2016-03-17T07:01:00.353486\",\n\t\"name\": \"campaign-finance-status-of-voluntary-expenditure-ceiling-vecs-in-november-4-2014-election-f4b60\",\n\t\"isopen\":
  true,\n\t\"url\": null,\n\t\"notes\": \"Under S.F. Campaign and Governmental Conduct
  Code 1.128, a candidate who wishes to accept the voluntary expenditure ceiling must
  file Form SFEC-128 no later than the August 8, 2014 deadline for filing nomination
  papers. In a race where at least one candidate has accepted the VEC, all candidates
  running for office in the same race must file Form SFEC 134(b) within 24 hours of
  receiving contributions, making expenditures, or having funds that exceed 100 percent
  of the applicable VEC. In addition, any person other than a candidate committee
  who makes or incurs expenditures for the purpose of distributing independent expenditures,
  electioneering communications, or member communications that clearly identify any
  candidate that equals or exceeds $5,000 per candidate, must within 24 hours of each
  time it reaches the $5,000 threshold file a Third Party Disclosure Form.\",\n\t\"license_title\":
